import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0202002 from '../../include/Pop_C0202002';
import Pop_C0202005 from '../../include/Pop_C0202005';
import Pop_C0202006 from '../../include/Pop_C0202006';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm03'}
                                name={'sm03'}
                                label={'제품명'}

                            />

                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm04'}
                                name={'sm04'}
                                label={'제품ID번호'}

                            />

                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="진행현황"
                                useAll
                            />
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm03'}
                                name={'sm03'}
                                label={'MBR 번호'}

                            />

                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'버전번호'}

                            />
                            <OwpSearchTextField
                                className="w-160"
                                id={'sm04'}
                                name={'sm04'}
                                label={'이름'}

                            />
                            <OwpSearchDateTimePickerMulti
                                name="sm02"
                                initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                labels={{ start: ' 배치발행시작111', end: '종료일' }}
                                inputProps={{ start: { style: { width: 120 } }, end: { style: { width: 120 } } }}
                                required={true}
                            />



                            {/*Hidden 필수 값*/}
                            {/* <OwpSearchTextField
                                className="hidden"
                                name="OWP_PRODPLAN.PLAN_TYPE"
                                value="D006002"
                            /> */}
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="Master 제조지시 조회">
                            <OwpButton color={'secondary'} variant={'outlined'}>
                                엑셀양식
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'outlined'}>
                                엑셀저장
                            </OwpButton>
                            <Pop_C0202002/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                                COPY
                            </OwpButton>
                            <Pop_C0202005/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                                수정
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                                삭제
                            </OwpButton>
                            {/* <Pop_C0202005/> */}
                            <Pop_C0202006/>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0202000"
                                LayoutUrl={'/assets/data/C0202000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
